import Index from './Components/Index'
import './App.css';
import { useFirebaseApp} from 'reactfire'
import Links from './Components/Links'
import LinkForm from './Components/LinkForm';

function App() {

  const firebase = useFirebaseApp();
  console.log(firebase);
  return (
    <div className="App">
     <Index />
     <LinkForm/> 
     <Links/>
    </div>
  );
}

export default App;
